		// for touch, display the arrows
		if (!("ontouchstart" in window)) {
			overlay.append(prevArrow).append(nextArrow);

			prevArrow.click(function (e) {
				e.preventDefault();
				showPrevious();
			});

			nextArrow.click(function (e) {
				e.preventDefault();
				showNext();
			});
		}

